import './App.css';
import NavBar from "./NavBar";
import Home from './Home';
import React, {useState} from "./react"
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import FavoriteKittens from './FavoriteKittens';
import AddNewKitten from './AddNewKitten';

function App() {
  const [favoriteKittens, setFavoriteKittens] = useState([]);

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <NavBar />
          <Switch>
            <Route path="/favorites">
              <FavoriteKittens favorites={favoriteKittens} />
            </Route>
            <Route path="/add-new-kitten">
              <AddNewKitten />
            </Route>
            <Route path="/">
              <Home setFavorites={setFavoriteKittens} />
            </Route>
          </Switch>
        </header>
      </div>
    </Router>
  );
}

export default App;
